import React from 'react'

export default function pageButton({ type, page, changePage }) {
    return (
        <div onClick={() => changePage(type === "prev" ? page - 1 : page + 1)}>
            <span>Page {type === "prev" ? page - 1 : page + 1}</span>            
            <i className="fas fa-shopping-cart"></i>
        </div>
    )
}
